	return (props) => {
		const router = useRouter();
		const accessToken = API.TOKEN;
            let isTokenVerified

            useEffect(()=>{

                  // if no accessToken was found,then we redirect to "/" page.
                         if (!accessToken) {
                               router.replace("/admin/login");
                               console.log(accessToken)
                         }else{
                               const isTokenVerified  =  whoami(accessToken)
                         
